import styled from "styled-components";
import Button from '@mui/material/Button';
import { Link } from "react-router-dom";
const Box = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
    width: 600px;
    margin-left: 500px;
`




function Btn(props) {

    return(
        <Box>
            <Link to='/assets'>
        <Button size="small" variant="contained">Modelos</Button>
        </Link>
        <Link to='/users'>
        <Button size="small" variant="contained">Usuarios</Button>
        </Link>
        <Button size="small"variant="contained">Gráficos</Button>
        
        </Box>
        
    )

}

export default Btn;
